import React, { Component } from "react";
import axios from "axios";

class Description extends Component {
  state = {};

  getinfo = () => {
    axios.get("http://localhost:5000/info").then((res) => console.log(res));
  };

  render() {
    return (
      <React.Fragment>{console.log(this.props.match.params.id)}</React.Fragment>
    );
  }
}
export default Description;
